import axios from "axios";

// Create Post

export const createPost = (title, body) => {
	console.log("Create post function executed.");

	console.log("title is:", title);
	console.log("body is:", body);

	const config = {
		headers: {
			"Content-Type": "application/json",
		},
	};

	// Request Body
	const requestBody = JSON.stringify({ username, title, body });

	axios
		.post("http://127.0.0.1:8000/api/post-submit/", requestBody, config)
		.then((res) => {
			console.log(res)
		})
		.catch((err) => console.log(err));
};
